import React from 'react'

export default function Intro(props) {

    return (
        <div>
            <h1>Quizzical</h1>
            <h4>Ready to get your mind blown?</h4>
            <button onClick={props.startQuiz} >Start Quiz</button>
        </div>
    )
}
